import React from "react";
import "./Nav.css";
import { Link } from "react-router-dom";

function Nav() {
  const navStyle = {
    color: "black",
    textDecoration: "none"
  };

  return (
    <nav>
      <Link style={navStyle} to="/">
        <h3>logo</h3>
      </Link>
      <ul>
        <li>
          <Link to="/home">home</Link>
        </li>
        <li>
          <Link to="/random">random</Link>
        </li>
        <li>
          <Link to="/search">search</Link>
        </li>
        <li>
          <Link to="/about">about</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Nav;
